import React from 'react';
import { Link } from 'react-router-dom';

import './Home.scss';

const Home = () => {
	return (
		<div className='home'>
			<div className='home-image'>
				<h1>Welcome to 96th Ave. Coffee</h1>
				<Link to='/coffees' className='shop-button'>
					Shop
				</Link>
			</div>
		</div>
	);
};

export default Home;
